import { NgModule } from '@angular/core';
import { Routes, RouterModule } from '@angular/router';

const routes: Routes = [{
  path: '',
  loadChildren: () => import('./components/posts/posts.module')
    .then(m => m.PostsModule)
}, {
  path: 'posts',
  loadChildren: () => import('./components/posts/posts.module')
    .then(m => m.PostsModule)
}, {
  path: 'map',
  loadChildren: () => import('./pages/map/map.module')
    .then(m => m.MapModule),
  canActivate: [KeycloakAuthGuard],
  data: {
    roles: ['Global Manager']
  }
}, {
  path: 'factories',
  loadChildren: () => import('./pages/factories-list/factories-list.module')
    .then(m => m.FactoriesListModule),
  canActivate: [KeycloakAuthGuard],
  data: {
    roles: ['Global Manager']
  }
}, {
  path: 'factories/:id',
  loadChildren: () => import('./pages/factory-info/factory-info.module')
    .then(m => m.FactoryInfoModule),
  canActivate: [KeycloakAuthGuard],
  data: {
    roles: ['Global Manager']
  }
}, {
  path: 'auth/redirect',
  loadChildren: () => import('./pages/auth-redirect/auth-redirect.module')
    .then(m => m.AuthRedirectModule),
  data: {
    showHeader: false,
    showSidebar: false
  }
}, {
  path: '**',
  redirectTo: 'dashboard',
  pathMatch: 'full'
}];

@NgModule({
  imports: [
  RouterModule.forRoot(routes)
  ],
  exports: [
    RouterModule
  ],
  providers: [
    UnauthRequiredAuthGuard,
    KeycloakAuthGuard
  ]
})
export class AppRoutingModule { }
